import React from 'react'
import styled from 'styled-components';

const NavBtn = styled.div`
    width: 40px;
    height: 40px;
    background: red;
    position: fixed;
    top: 0;
    left: 0;
    display: none;
    
    @media screen and (max-width: 900px) {
        display: block;
    }
`

function HambergerBtn({ isOpened, handleClickHambergerBtn }) {
    return (
        <NavBtn isOpened={isOpened} onClick={handleClickHambergerBtn} />
    )
};

export default HambergerBtn;
